#player,#player a{ color:transparent;  font-size:12px; font-family:Tahoma;}
#player{ background:url(); background-position:bottom; background-color: transparent;}
#player .mainImage{ background:url(http://static.tumblr.com/d41lcii/k8mo1sfrn/sem_t__tulo.png); }

#player #baseLeft{ width:93px; }
#player #baseRight{ width:145px;}
